import React, { useState } from 'react';

const mockData = [
  { id: 1, name: '山田 太郎', email: 'taro@example.com' },
  { id: 2, name: '鈴木 花子', email: 'hanako@example.com' },
  { id: 3, name: '佐藤 次郎', email: 'jiro@example.com' },
];

function HomePage() {
  const [data, setData] = useState([]);

  const handleLoadData = () => {
    // 実際はAPIを呼ぶようになるけど、今はモックでOK！
    setData(mockData);
  };

  return (
    <div style={{ padding: 20 }}>
      <h2>ホーム画面</h2>
      <button onClick={handleLoadData}>データを読み込む</button>

      {data.length > 0 && (
        <table border="1" cellPadding="8" style={{ marginTop: 20 }}>
          <thead>
            <tr>
              <th>ID</th>
              <th>名前</th>
              <th>メール</th>
            </tr>
          </thead>
          <tbody>
            {data.map((person) => (
              <tr key={person.id}>
                <td>{person.id}</td>
                <td>{person.name}</td>
                <td>{person.email}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default HomePage;
